// Helper function to get the price by weight in grams
export const getEubPriceByWeight = (weightGrams: number): number => {
  // Round to nearest gram
  const roundedWeight = Math.round(weightGrams);
  
  // Check if we have an exact match
  if (cssbuyEubPrices[roundedWeight]) {
    return cssbuyEubPrices[roundedWeight];
  }
  
  // For weights less than 500g, return the 500g price
  if (roundedWeight < 500) {
    return cssbuyEubPrices[500];
  }
  
  // For weights more than 3000g, return -1 (to indicate not available)
  if (roundedWeight > 3000) {
    return -1;
  }
  
  // This should never happen with our complete data, but just in case
  return -1;
};
